import React from 'react'
import { BarChart } from 'chart.js'
const BarChart1 = () => {
    return (
        <div>
            <BarChart 
                data={{
                    labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
                    // data: [65, 59, 80, 81, 56, 55, 40],
                }}
                height={400}
                width={600}
                options={{maintainAspectRation: false,}}
            />
        </div>
    )
}

export default BarChart1
